#PRIMERA PARTE
#-------------

#Idea general --> Iteramos en dos dimensiones volviendo a meter la columna cuando se salga

right = 3
down = 1
 
def Trees(input, right, down):
    n_trees = 0
    rows = len(input)
    columns = len(input[0])
    pos = [0,0]         #par fila-columna
    
    while pos[0] < rows-1:
        pos[0] += down
        pos[1] += right
        if pos[1] >= columns:
            pos[1] %= columns
        if input[pos[0]][pos[1]] == '#':
            n_trees+=1
    
    return n_trees

print(Trees(input,right,down))


#SEGUNDA PARTE
#-------------

right_down = [         #The differents slopes
    1,1,
    3,1,
    5,1,
    7,1,
    1,2
]

def MultiplyTrees(right_down):
    result = 1
    i = 0
    while i < len(right_down):
        result *=  Trees(input,right_down[i], right_down[i+1])
        i += 2
    
    return result

print(MultiplyTrees(right_down))